```python
def my_func(input1: str):
    words = input1.split()
    result = []
    for word in words:
        if len(word) > 4:
            result.append(word[::-1])
        else:
            result.append(word)
    return ' '.join(result)
```

This implementation splits the input string into words, checks the length of each word, and reverses the word if its length is greater than four. Finally, it joins the processed words back into a single string with spaces in between.
